import React from 'react';
import styled from 'styled-components';


const  Wapper = styled.button`
background-color: #59B2E0;
outline: none;
color: #fff;
font-size: 14px;
height: auto;
font-weight: normal;
padding: 14px 0;
text-transform: uppercase;
border-color: #59B2E6;
    width: 150px;
    margin-left: 170px;
    margin-top: 60px;
`


const Button = ({
    onClick,
    name
}) => (

      <Wapper>{name}</Wapper>
)

export default Button;
